import { useContext } from "react";
import {observer} from "mobx-react";
import Bible from "./Bible";
import Comments from "./Comments";
import StoresContext from "../util/context";


const Nav = observer(
function Nav () {
  const store = useContext(StoresContext)

  return (
    <>
      {/*Bible container*/}
      {store.navStore.navPosition === 'top' ? '' : (<div className={`overflow-auto flex-1`}> <Bible/> </div>)}
      {/* Nav container */}
      <div className={"flex justify-center flex-initial"}>
        <button className={'ml-6  justify-self-start m-auto'}>
          <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1} d="M11 5H6a2 2 0 00-2 2v11a2 2 0 002 2h11a2 2 0 002-2v-5m-1.414-9.414a2 2 0 112.828 2.828L11.828 15H9v-2.828l8.586-8.586z" />
          </svg>
        </button>
        {/*up button*/}
        <button onClick={() => {store.navStore.handleNavPosition('top'); console.log(store.navStore.navPosition)}}>
          <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6 inline" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M5 15l7-7 7 7" />
          </svg>
        </button>
        {/*down button*/}
        <button onClick={() => {store.navStore.handleNavPosition('bottom'); console.log(store.navStore.navPosition)}}>
          <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6 inline" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
          </svg>
        </button>
        <button className={'ml-6 ml-auto justify-self-end '}> <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" fill="none" viewBox="0 0 24 24" stroke="transparent"> <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1} d="M11 5H6a2 2 0 00-2 2v11a2 2 0 002 2h11a2 2 0 002-2v-5m-1.414-9.414a2 2 0 112.828 2.828L11.828 15H9v-2.828l8.586-8.586z" />
          </svg>
        </button>
      </div>
      {/*Comments container*/}
      {store.navStore.navPosition === 'bottom' ? '' : (
      <div className={'overflow-auto flex-1'}>
        <Comments/>
      </div>
      )}
      </>
  )
})

export default Nav
